file = "horse"; %[control:dropdown:60ac]{"position":[8,15]}
resample_rate = 6000; %[control:slider:271d]{"position":[17,21]}
sine_wave_amount = 3; %[control:slider:8818]{"position":[20,21]}

warning('off','all');
[d,r] = audioread(file + ".wav");
sound(d,r);
pause(5.0);
[F,M] = swsmodel(d,r,sine_wave_amount,resample_rate); %[output:028b5480]
dr = synthtrax(F,M,r);
% Listen to it
sound(dr,r);
subplot(2,1,1) %[output:99202728]
specgram(d(:,1),256,r) %[output:99202728]
title('Spectrogram of Original Speech'); %[output:99202728]
subplot(2,1,2) %[output:99202728]
specgram(dr,256,r) %[output:99202728]
title('Spectrogram of Sine Wave Replica'); %[output:99202728]

